    #[cfg(feature = "eval")]
    pub const fn rune_const_eval(ctx: &Ctx, rune_id: RuneId, attack_type: AttackType) -> f32 {
        match rune_id {
            RuneId::Aftershock => match attack_type {
                AttackType::Melee => aftershock(ctx),
                AttackType::Ranged => aftershock(ctx),
            },
            RuneId::ArcaneComet => match attack_type {
                AttackType::Melee => arcane_comet(ctx),
                AttackType::Ranged => arcane_comet(ctx),
            },
            RuneId::CheapShot => match attack_type {
                AttackType::Melee => cheap_shot(ctx),
                AttackType::Ranged => cheap_shot(ctx),
            },
            RuneId::DarkHarvest => match attack_type {
                AttackType::Melee => dark_harvest(ctx),
                AttackType::Ranged => dark_harvest(ctx),
            },
            RuneId::Electrocute => match attack_type {
                AttackType::Melee => electrocute(ctx),
                AttackType::Ranged => electrocute(ctx),
            },
            RuneId::GraspOfTheUndying => match attack_type {
                AttackType::Melee => grasp_of_the_undying_melee(ctx),
                AttackType::Ranged => grasp_of_the_undying_ranged(ctx),
            },
            RuneId::Predator => match attack_type {
                AttackType::Melee => predator(ctx),
                AttackType::Ranged => predator(ctx),
            },
            RuneId::PressTheAttack => match attack_type {
                AttackType::Melee => press_the_attack(ctx),
                AttackType::Ranged => press_the_attack(ctx),
            },
            RuneId::Scorch => match attack_type {
                AttackType::Melee => scorch(ctx),
                AttackType::Ranged => scorch(ctx),
            },
            RuneId::SuddenImpact => match attack_type {
                AttackType::Melee => sudden_impact(ctx),
                AttackType::Ranged => sudden_impact(ctx),
            },
            RuneId::SummonAery => match attack_type {
                AttackType::Melee => summon_aery(ctx),
                AttackType::Ranged => summon_aery(ctx),
            },
            _ => 0.0,
        }
    }
